export const getUpdateData = (data) => {
    const rawData = {
        identifier_token: data.identifier_token,
        hashed_password: data.hashed_password,
        ...data.user_data,
    };
    const result = {};
    for (const key in rawData) {
        if (rawData[key] === undefined)
            continue;
        result[key] = rawData[key];
    }
    return result;
};
